import React, { useState } from 'react';

const Deposit: React.FC = () => {
  const [suma, setSuma] = useState<number | ''>('');
  const [mesaj, setMesaj] = useState<string>('');
  const [istoric, setIstoric] = useState<number[]>([]); // depozite anterioare

  const handleDepunere = () => {
    if (typeof suma !== 'number' || suma <= 0) {
      setMesaj('Introdu o sumă validă.');
      return;
    }
    setMesaj(`Ai depus cu succes ${suma.toFixed(2)} RON.`);
    setIstoric((prev) => [suma, ...prev]);
    setSuma('');
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        backgroundImage: "url('/images/background-casino.jpg')",
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundRepeat: 'no-repeat',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'flex-start',
        paddingTop: '4rem',
        paddingBottom: '4rem',
      }}
    >
      <div
        style={{
          maxWidth: '480px',
          width: '100%',
          padding: '2rem',
          backgroundColor: 'rgba(255, 255, 255, 0.9)',
          borderRadius: '16px',
          boxShadow: '0 20px 25px -5px rgba(0,0,0,0.1)',
          userSelect: 'none',
        }}
      >
        <h1
          style={{
            fontSize: '2rem',
            fontWeight: '700',
            marginBottom: '1.5rem',
            textAlign: 'center',
            color: '#059669',
          }}
        >
          💰 Depunere Fonduri
        </h1>

        <label
          htmlFor="suma"
          style={{
            display: 'block',
            fontWeight: '600',
            marginBottom: '0.5rem',
            color: '#374151',
          }}
        >
          Sumă (RON):
        </label>
        <input
          id="suma"
          type="number"
          value={suma}
          onChange={(e) => {
            const val = e.target.value;
            setSuma(val === '' ? '' : parseFloat(val));
          }}
          placeholder="Introdu suma..."
          style={{
            width: '100%',
            padding: '0.75rem 1rem',
            borderRadius: '12px',
            border: '1px solid #d1d5db',
            fontSize: '1rem',
            marginBottom: '1.25rem',
            outline: 'none',
            transition: 'border-color 0.3s ease',
          }}
          onFocus={(e) => (e.currentTarget.style.borderColor = '#059669')}
          onBlur={(e) => (e.currentTarget.style.borderColor = '#d1d5db')}
        />

        <button
          onClick={handleDepunere}
          style={{
            width: '100%',
            backgroundColor: '#059669',
            color: 'white',
            padding: '0.75rem',
            borderRadius: '12px',
            fontWeight: '700',
            fontSize: '1.1rem',
            cursor: 'pointer',
            border: 'none',
            transition: 'background-color 0.3s ease',
            userSelect: 'none',
          }}
          onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = '#047857')}
          onMouseLeave={(e) => (e.currentTarget.style.backgroundColor = '#059669')}
        >
          Depune
        </button>

        {mesaj && (
          <p
            style={{
              marginTop: '1rem',
              textAlign: 'center',
              color: '#059669',
              fontWeight: '600',
              userSelect: 'text',
            }}
          >
            {mesaj}
          </p>
        )}

        {/* Istoric depozite sub formular */}
        {istoric.length > 0 && (
          <div
            style={{
              marginTop: '2.5rem',
              borderRadius: '16px',
              border: '1px solid #e5e7eb',
              boxShadow: '0 10px 15px -3px rgba(0,0,0,0.05)',
              overflow: 'hidden',
              backgroundColor: 'white',
              userSelect: 'none',
            }}
          >
            <table
              style={{
                width: '100%',
                borderCollapse: 'collapse',
                userSelect: 'none',
              }}
            >
              <caption
                style={{
                  captionSide: 'top',
                  textAlign: 'center',
                  fontSize: '1.5rem',
                  fontWeight: '700',
                  padding: '12px 0',
                  color: '#059669',
                }}
              >
                📜 Istoric Depuneri
              </caption>
              <thead>
                <tr
                  style={{
                    background:
                      'linear-gradient(90deg, #059669 0%, #047857 100%)',
                    color: 'white',
                    userSelect: 'none',
                  }}
                >
                  <th
                    style={{
                      padding: '16px',
                      textAlign: 'center',
                      fontWeight: '700',
                      fontSize: '14px',
                      textTransform: 'uppercase',
                      letterSpacing: '0.1em',
                    }}
                  >
                    Nr.
                  </th>
                  <th
                    style={{
                      padding: '16px',
                      textAlign: 'center',
                      fontWeight: '700',
                      fontSize: '14px',
                      textTransform: 'uppercase',
                      letterSpacing: '0.1em',
                    }}
                  >
                    Sumă Depusă (RON)
                  </th>
                </tr>
              </thead>
              <tbody>
                {istoric.map((dep, index) => (
                  <tr
                    key={index}
                    style={{
                      backgroundColor:
                        index % 2 === 0 ? 'white' : '#f8fafc',
                      transition: 'background-color 0.3s ease',
                    }}
                    onMouseEnter={(e) =>
                      (e.currentTarget.style.backgroundColor = '#f0f9ff')
                    }
                    onMouseLeave={(e) =>
                      (e.currentTarget.style.backgroundColor =
                        index % 2 === 0 ? 'white' : '#f8fafc')
                    }
                  >
                    <td
                      style={{
                        padding: '16px',
                        textAlign: 'center',
                        fontWeight: '600',
                        color: '#374151',
                      }}
                    >
                      {istoric.length - index}
                    </td>
                    <td
                      style={{
                        padding: '16px',
                        textAlign: 'center',
                        fontWeight: '700',
                        color: '#059669',
                      }}
                    >
                      {dep.toLocaleString('ro-RO', {
                        minimumFractionDigits: 2,
                        maximumFractionDigits: 2,
                      })}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default Deposit;
